import Container from "../components/Container";
import axios from "axios";

const Index = (props) => {
  return (
    <Container title="Home">
      <h3>Hola</h3>
    </Container>
  );
};

Index.getInitialProps = async (ctx) => {
  axios.get("https://rickandmortyapi.com/api/character")
  .then((res) => {
    console.log(res);
    return {};
  })
  .catch(err=>{
      console.log(err);
      return {}
  })

};

export default Index;
